import React from "react";
import Chart from "chart.js";

function StatisticalMonthOfBranch() {
  const data = {
    labels: ["Red", "Blue", "Yellow"],
    datasets: [
      {
        label: "# of Votes",
        data: [12, 19, 3],
        backgroundColor: ["red", "blue", "yellow"],
      },
    ],
  };

  return (
    <div>
      <h1>DAng VY khoi</h1>
      {/* <Pie data={data} /> */}
    </div>
  );
}

export default StatisticalMonthOfBranch;
